  return (
    <nav class="navbar navbar-light bg-light">
      <div className="container-fluid">
        <Link to="/" className="navbar-nav">
          Home
        </Link>
        <Link to="/" className="navbar-nav">
          Home
        </Link>
      </div>
    </nav>
  );
